import React from 'react';
import { useNavigate } from 'react-router-dom'
import './Navbar.css';   // to alter the appearance of Navbar.js program



const Navbar = (props) => {
    const navigate = useNavigate();
    return (
        <nav className='navbar'>
            <ul className='nav-links'>
                <li>
                    <a href='/'>Home</a>
                </li>
                <li>
                    {props.loggedIn === true ? <a href='/create-event'>Create an Event</a> : <a href='/sign-in' onClick={(e) => { e.preventDefault(); useNavigate('/sign-in'); }}>Create an Event</a>}
                </li>
                <li>
                    {props.loggedIn === true ? <a href='/profile'>Profile</a> : <a href='/sign-in'onClick={(e) => { e.preventDefault(); useNavigate('/sign-in'); }}>Profile</a>}
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
